function cleanUpXAxis(results) {
	labels = results[0];
	for (var i = 0; i < labels.length; i++) {
		if (i%10 != true) {
			labels[i] = '';
		}
	}
	return ([labels, results[1]]);
}

// docwrite(JSON.stringify(cleanUpXAxis(diasbpm)));

function barConvertA1C(results) {
	labels = results[0];
	newData = []
	newLabels = []
	for (var i = 0; i < labels.length; i++) {
		if (i%20 == true) {
			newLabels.push(labels[i]);
			newData.push(results[1][i]);

		}
	}
	return[newLabels, newData];
}

// docwrite(JSON.stringify(barConvertA1C(A1C)));

function pareDownGlucose(results) {
	labels = [];
	data = [];
	for (var i = 0; i < results[0].length; i++) {
		if (i%5 == true) {
			labels.push(results[0][i]);
			data.push(results[1][i]);
		}
	}
	return [labels, data];
}

